99a23a4c1b068982455fe24523f36c83:
query CountriesListQuery {
  countries_countries {
    ...CountryName
    continent {
      ...ContinentName
    }
  }
}

fragment ContinentName on countries_Continent {
  code
  name
}

fragment CountryName on countries_Country {
  code
  name
}

ac0bbf845a836254bf536ee2b069dd86:
query ContinentsListQuery {
  countries_continents {
    ...ContinentName
    countries {
      ...CountryName
    }
  }
}

fragment ContinentName on countries_Continent {
  code
  name
}

fragment CountryName on countries_Country {
  code
  name
}
